From the problem, we have two pieces of information:
1. Three tricycles and one股市 weigh the same as three squares.
2. Two tricycles and one股市 weigh the same as one square.

We can translate these pieces of information into the following equations:
1. \( 3T + C = 3S \)
2. \( 2T + C = S \)

We need to find the weight of four tricycles in terms of the weight of one square. First, let's eliminate \( C \) by subtracting the second equation from the first:
\[ (3T + C) - (2T + C) = 3S - S \]
\[ 3T + C - 2T - C = 2S \]
\[ T = 2S \]

Now that we know \( T = 2S \), we can substitute this value into the second equation to find \( C \):
\[ 2T + C = S \]
\[ 2(2S) + C = S \]
\[ 4S + C = S \]
\[ C = S - 4S \]
\[ C = -3S \]

